CREATE TABLE tblActivationRequests
(
  Id CHAR(36) PRIMARY KEY,
  UserId CHAR(36),
  ActivationRequestDateTime DATETIME,

  FOREIGN KEY (UserId) REFERENCES tblUsers(Id)
);

CREATE TABLE tblRemindPasswordRequests
(
  Id CHAR(36) PRIMARY KEY,
  UserId CHAR(36),
  RemindPasswordRequestDateTime DATETIME,

  FOREIGN KEY (UserId) REFERENCES tblUsers(Id)
);


CREATE TABLE tblKeys
(
  Id VARCHAR(30) PRIMARY KEY,
  Value VARCHAR(1500)
);


CREATE TABLE tblFriendRelationships
(
  UserId CHAR(36),
  FriendId CHAR(36),
  PRIMARY KEY (UserId, FriendId),
  FOREIGN KEY (UserId) REFERENCES tblUsers(Id),
  FOREIGN KEY (FriendId) REFERENCES tblUsers(Id)
);


DROP TABLE IF EXISTS tblMessages;
CREATE TABLE tblMessages
(
  Id CHAR(36),
  Title TEXT,
  Content LONGTEXT,
  CreationTime DATETIME,
  PRIMARY KEY (Id)
);

DROP TABLE IF EXISTS tblNotifications;
CREATE TABLE tblNotifications
(
  FromUserId CHAR(36),
  ToUserId CHAR(36),
  MessageId CHAR(36),
  PRIMARY KEY (FromUserId, ToUserId, MessageId),
  FOREIGN KEY (FromUserId) REFERENCES tblUsers(Id),
  FOREIGN KEY (ToUserId) REFERENCES tblUsers(Id),
  FOREIGN KEY (MessageId) REFERENCES tblMessages(Id)
);

CREATE TABLE tbllocations
(
  Id INT PRIMARY KEY NOT NULL,
  country CHAR(2),
  city LONGTEXT,
  latitude DOUBLE,
  longitude DOUBLE
);

CREATE TABLE tblips
(
  StartIpNum INT UNSIGNED DEFAULT 0 NOT NULL,
  EndIpNum INT UNSIGNED DEFAULT 0 NOT NULL,
  LocationId INT,
  CONSTRAINT pk_ips PRIMARY KEY (startIpNum, endIpNum),
  CONSTRAINT fk_locationid FOREIGN KEY (LocationId) REFERENCES tbllocations(Id)
);

